function getPoints(node) {
    const points = {}
    node.startNode ? points.startNode = node: (node.endNode ? points.endNode = node: null)
    return points
}

function getNodes(grid) {
    const nodes = []
    for (let row of grid) {
        const currRow = []
        for(var node of row) {
            const currNode = node
            currRow.push(currNode)
            node.startNode ? () => getPoints(node) : (node.endNode ? () => getPoints(node) : null)
        }
        nodes.push(currRow)
    }
    return nodes 
}

